let img = "data:image/jpeg;base64,"
import {TextBlock, ImageBlock, ColumnsBlock, TitleBlock} from "./classes/block"

export const model = [

    new TitleBlock('Pure JS web-site constructor!', {
        tag: "h2",
        styles: {
            background: "linear-gradient(to left,#e66465, #9198e5)",
            color: "white",
            "text-align": "center"
        }
    }),
    new TextBlock('sometext', {
        tag: "p",
        styles: {
            color: "green"

        }


    }),
    new ColumnsBlock(["str1", "str2", "str3"], {
        tag: "p",
        styles: {
            color: "green"

        }


    }),
    new ImageBlock(img, {
        styles: {
            display: "flex",
            "justify-content": "center",

        },
        imgStyles: {
            width: "30%",

        },
        alt: "picture"

    })


];
